import React from "react";

const Header = ({ onHandleThemeClick }) => {
    return (
        <div className="header">
            <h1>Notes</h1>
            <button
                onClick={() => onHandleThemeClick((darkMode) => !darkMode)}
                className="button glassmorph"
            >
                Toggle Button
            </button>
        </div>
    );
};

export default Header;
